import React from 'react';
import headerImg from '../../media/images/headerImg.jpeg'
import GetGameData from '../../reducers/GameDataAPI';
const Header = (data) => {
    const instance = data.props;
    console.log('instance');
    console.log(instance);
    var thisInstance = GetGameData();
    return (
        <div className="header">
            <img src={headerImg} alt="Houston Rockets" />
            <div className="game-detail">
                <h3>Houston Rockets Box Score</h3>
                <h4>{thisInstance.date}</h4>
                <h4>{thisInstance.time}</h4>
                <h4>{thisInstance.city}, {thisInstance.state}</h4>
                <h4>{thisInstance.away} @ {thisInstance.home}</h4>
                <h4>{thisInstance.status}</h4>
            </div>
        </div>
    )
}

export default Header;
